import React from 'react';
import { navStyle } from '../navStyle';
import Button from 'react-bootstrap/Button';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import ButtonToolbar from 'react-bootstrap/ButtonToolbar';

class Navigation extends React.Component {

  render() {

    let { color, backgroundColor, brand, justifyContent } = navStyle;
    let navigationAlignment = {
        alignItems: 'center',
        justifyContent: 'flex-end'
    };

    return (
        <Navbar style={{backgroundColor}} expand="lg">
            <Navbar.Brand style={brand} href="#home" className="mr-auto">Personal Capital</Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav" style={{navigationAlignment}}>
              <Nav>
                <Nav.Link style={{color}} href="/home">Financial Tools</Nav.Link>
                <Nav.Link style={{color}}>Wealth Management</Nav.Link>
                <Nav.Link style={{color}}>About</Nav.Link>
                <Nav.Link style={{color}}>Resources</Nav.Link>
                <Nav.Link>
                  <Button href="#" variant="outline-warning">Login</Button>
                </Nav.Link>
                <Nav.Link>
                  <Button href="#" variant="warning">Sign Up</Button>
                </Nav.Link>
              </Nav>
            </Navbar.Collapse>
        </Navbar>
    )
  }
}

export default Navigation;
